import { Component, OnInit } from '@angular/core';
import { ModalController } from '@ionic/angular';

@Component({
  selector: 'app-modal-local',
  templateUrl: './modal-local.page.html',
  styleUrls: ['./modal-local.page.scss'],
})
export class ModalLocalPage implements OnInit {

  public fGroupLocal: frou

  constructor(
    private modalCtrl: ModalController
  ) { }

  close() {
    this.modalCtrl.dismiss();
  }


  ngOnInit() {
  }

}

<ion-content [fullscreen]="true">
  <div id="header">
    <div id="app-bar">
      <ion-icon name="arrow-back-outline" style="color: black;" (click)="close()"></ion-icon>
      <div id="logo">
        <img src="assets/icon/moio.png" alt="" />
      </div>
      <div></div>
    </div>
  </div>

<form>
  <div id="textLocal">
    <h1>Criar novo local</h1>
    <p>Cadastre um novo local para seus eventos, este cadastro é direcionado a locaslização</p>
    <div id="informacoes">
      <ion-input label="Nome do Local" labelPlacement="floating" [counter]="true" maxlength="100"></ion-input>
      <ion-input label="CEP" labelPlacement="floating" [counter]="true" maxlength="8"></ion-input>
      <ion-input label="Cidade" labelPlacement="floating" [counter]="true" maxlength="70"></ion-input>
      <ion-input label="Rua" labelPlacement="floating" [counter]="true" maxlength="70"></ion-input>
      <ion-input label="Número" labelPlacement="floating" [counter]="true" maxlength="10"></ion-input>
    </div>
  </div>

  <ion-button shape="round" name="enviar">Criar novo local</ion-button>
</form>



</ion-content>
